000Z", "text": "RT @tagesschau: Tarifstreit im \u00f6ffentlichen Dienst beigelegt http://goo.gl/fb/fjZk", "source": "Twitter Web Client", "id": "9750401360", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "4786417911", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-10-11T16:00:54.000Z", "text": "Immer wieder sonntags... versammelt sich das Wahlteam der Verbandsgemeindeverwaltung im Rathaus. Wir sind startklar f\u00fcr die Ausz\u00e4hlung.", "source": "Twitter Web Client", "id": "4786417911", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "4784692226", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-10-11T14:24:34.000Z", "text": "just voted \"Jamaica: Sommer, Sonne, wunderbar.\" on \"Rot-Rot-Gr\u00fcn oder Jamaica im #Saarland?\" vote too \u2794 http://bit.ly/xxFZg", "source": "POLLpigeon", "entities": {"hashtags": [{"start": 81, "end": 90, "tag": "Saarland"}]}, "id": "4784692226", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "4467278790", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-09-29T10:42:10.000Z", "text": "Nur bei der Kommunalwahl werden die Briefw\u00e4hler den einzelnen Wahlbezirken zugeordnet. Bei der Bundestagswahl ist das nicht der Fall.", "source": "Twitter Web Client", "id": "4467278790", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "entities": {"mentions": [{"start": 0, "end": 13, "username": "Hani_Faddoul", "id": "2544473112"}, {"start": 14, "end": 28, "username": "felix_schmitt", "id": "17221767"}]}, "conversation_id": "4467194916", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "4467194916"}], "reply_settings": "everyone", "created_at": "2009-09-29T10:41:00.000Z", "text": "@Hani_Faddoul @felix_schmitt Nur zur Info - die Erkl\u00e4rung f\u00fcr die Differenz bei den abgegebenen Stimmen liegt in der Wertung der Briefwahl.", "source": "Twitter Web Client", "in_reply_to_user_id": "21588698", "id": "4467265512", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2271469678", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T23:33:31.000Z", "text": "Ein weiterer, h\u00f6chst interessanter Wahlabend ist zu Ende. Jetzt gilt es, sich wieder den wirklich wichtigen Sachfragen zu widmen.", "source": "Twitter Web Client", "id": "2271469678", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2268092908", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T18:14:07.000Z", "text": "Respekt und Anerkennung f\u00fcr beide Kandidaten Utermark und Abt. Sie haben einen au\u00dfergew\u00f6hnlich engagierten u. innovativen Wahlkampf gef\u00fchrt.", "source": "Twitter Web Client", "id": "2268092908", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2267988988", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T18:03:55.000Z", "text": "Gl\u00fcckwunsch an den neuen Bad Emser Stadtb\u00fcrgermeister Birk Utermark. Ich freue mich auf die Zusammenarbeit.", "source": "Twitter Web Client", "id": "2267988988", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "entities": {"mentions": [{"start": 0, "end": 14, "username": "MKronschewski", "id": "918931538506665984"}]}, "conversation_id": "2266470037", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "2266470037"}], "reply_settings": "everyone", "created_at": "2009-06-21T15:39:31.000Z", "text": "@MKronschewski Ja, im Sitzungssaal der VGV werden die Ergebnisse wieder ganz aktuell pr\u00e4sentiert.", "source": "Twitter Web Client", "in_reply_to_user_id": "40061719", "id": "2266525540", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265715601", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T14:09:59.000Z", "text": "Au\u00dferdem muss ich diese Namen einmal w\u00f6chentlich im B\u00fcro des amtierenden Stadtb\u00fcrgermeisters Canz aufsagen.", "source": "Twitter Web Client", "id": "2265715601", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265695805", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T14:07:33.000Z", "text": "Wohl dem, der das umfangreiche Buch \"Die Geschichte der Stadt Bad Ems\" von Dr. Sarholz im Regal stehen hat. Darin findet man alle Daten.", "source": "Twitter Web Client", "id": "2265695805", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265681712", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T14:05:54.000Z", "text": "Ihm folgten in dieser Reihenfolge Ludwig Hahn, Waldemar K\u00fchnel, Ernst Then, Heinrich Schmidt, Klaus Wissgott und Stephan Bilo.", "source": "Twitter Web Client", "id": "2265681712", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265619297", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-21T13:58:29.000Z", "text": "Dann wollen wir das nette kleine Sonntagsquiz der RLZ mal aufl\u00f6sen. 1. regul\u00e4rer Nachkriegsb\u00fcrgermeister von Bad Ems war Albert Wiswedel.", "source": "Twitter Web Client", "id": "2265619297", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265524894", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "2265524894"}], "reply_settings": "everyone", "created_at": "2009-06-21T13:56:51.000Z", "text": "@RZBadEms Die Z\u00e4hlteams sind absolut fit. Ich rechne mit einer sehr z\u00fcgigen Ergebnisermittlung.", "source": "Twitter Web Client", "in_reply_to_user_id": "22027855", "id": "2265606363", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265524894", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "2265524894"}], "reply_settings": "everyone", "created_at": "2009-06-21T13:50:24.000Z", "text": "@RZBadEms Es waren bisher insgesamt acht Stadtb\u00fcrgermeister seit 1945. Richtig?", "source": "Twitter Web Client", "in_reply_to_user_id": "22027855", "id": "2265556024", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2265308808", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "2265308808"}], "reply_settings": "everyone", "created_at": "2009-06-21T13:22:15.000Z", "text": "@RZBadEms Ein kleines Quiz am Sonntagnachmittag. Die RLZ wird immer kreativer! Ich bin begeistert und auf den Gewinner gespannt.", "source": "Twitter Web Client", "in_reply_to_user_id": "22027855", "id": "2265343937", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "entities": {"mentions": [{"start": 0, "end": 13, "username": "Hani_Faddoul", "id": "2544473112"}]}, "conversation_id": "2197361987", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "2197361987"}], "reply_settings": "everyone", "created_at": "2009-06-16T20:50:46.000Z", "text": "@Hani_Faddoul Was sagt denn Frau Eckstein dazu? Ich hoffe doch, f\u00fcr diese engagierte Dame ist der beste Sitzplatz schon reserviert.", "source": "Twitter Web Client", "in_reply_to_user_id": "21588698", "id": "2197484866", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2196243468", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "replied_to", "id": "2196243468"}], "reply_settings": "everyone", "created_at": "2009-06-16T20:35:24.000Z", "text": "@RZBadEms Liveticker? Kein Bedarf! Wir werden am Sonntag mit den Ergebnissen so schnell sein, dass kein Liveticker eine Chance hat...", "source": "Twitter Web Client", "in_reply_to_user_id": "22027855", "id": "2197289143", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2065767840", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-07T16:15:04.000Z", "text": "Gespanntes Warten im Ausz\u00e4hlzentrum der VGV Bad Ems. Welches Wahllokal meldet das erste Ergebnis.", "source": "Twitter Web Client", "id": "2065767840", "lang": "de"}, {"author_id": "28089973", "possibly_sensitive": false, "conversation_id": "2065550365", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2009-06-07T15:49:33.000Z", "text": "Stimmbezirk 103 ist das Wahllokal im Alten Rathaus in Bad Ems. Das Wahllokal mit den meisten Wahlberechtigt